6. Collections
List
List numbers = [1, 2, 3, 4];
numbers.add(5);
print(numbers[0]); // 1

Set
Set fruits = {"Apple", "Banana", "Apple"}; // no duplicates
fruits.add("Orange");
print(fruits);

Map
Map scores = {"Alice": 90, "Bob": 85};
scores["Charlie"] = 88;
print(scores["Alice"]); // 90


7. Null Safety
String? name; // can be null
name = "E-Jay";

int length = name!.length; // ! asserts it's not null


8. Classes and Objects
class Person {
  String name;
  int age;

  // Constructor
  Person(this.name, this.age);

  // Named constructor
  Person.guest() : name = "Guest", age = 0;

  void greet() {
    print("Hello, I am $name, $age years old.");
  }
}

void main() {
  Person p1 = Person("E-Jay", 25);
  p1.greet();

  Person p2 = Person.guest();
  p2.greet();
}


9. Inheritance
class Animal {
  void eat() => print("Animal is eating");
}

class Dog extends Animal {
  void bark() => print("Dog is barking");
}

void main() {
  Dog dog = Dog();
  dog.eat();
  dog.bark();
}


10. Interfaces and Abstract Classes
abstract class Shape {
  double area();
}

class Circle implements Shape {
  double radius;
  Circle(this.radius);

  @override
  double area() => 3.14 * radius * radius;
}


11. Exception Handling
void main() {
  try {
    int result = 12 ~/ 0; // integer division
  } catch(e) {
    print("Error: $e");
  } finally {
    print("Finally block executed");
  }
}


12. Async & Await
Future fetchData() async {
  await Future.delayed(Duration(seconds: 2));
  return "Data fetched";
}

void main() async {
  print("Fetching...");
  String data = await fetchData();
  print(data);
}


13. Lambdas / Anonymous Functions
var numbers = [1,2,3];
numbers.forEach((n) => print(n));

var square = (int x) => x * x;
print(square(5)); // 25


14. Operators

Arithmetic: + - * / ~/ % ++ --
Comparison: == != > = 
Logical: && || !
Type: is, is!
Null-aware: ??, ??=, ?., !..

int? a;
int b = a ?? 10; // if a is null, use 10


15. Misc

String Interpolation: "$name is $age years old"
Multi-line Strings:

String text = '''
Line 1
Line 2
''';


Raw Strings: r"This is raw \n no newline"
